されるべき人格がある。彼等は敬意を受けるべきだ。それは味方に限らず、その村のライバルたちにも等しくね。きみの腕前の見せどころだ。\nただ、キャラクターがキャラクターに敬意を払うか、尊重するかはご自由に。"},{"head":"発言や行動に、棘や毒がまだ残ってない？","log":"紳士・淑女でいよう。きみがここにいるのは、周囲に刺々しさや毒気をばらまくためではなかったはずだ。"},{"head":"言いたいことを言い尽くせた？そうでないなら、なぜ？","log":"更新までの時間や発言は、とても限られている。思いやりが不十分だったり、刺々しさや毒気が残ってしまったとしても、懸命に考えたならやむを得ない。\n自分自身の未熟さを認めて発言ボタンを押そう。"},{"head":"きみへの論評に反論する？それとも受け入れる？それはなんのため？","log":"多くの評価がきみに向けられる。どう対応するのかで、きみは味方にも、敵にも、美しくも、情けなくも見えるだろうね。今日のきみは、周囲からどう見えると好都合だろう。"},{"head":"その嘘、ほんと？","log":"言葉はどれも嘘かもしれないし、本当かもしれない。あっていい言葉が欠けているかもしれない。どうやって見極めよう？どうして見極めきれないんだろう？"},{"head":"参加時間はお好みで。","log":"きみが好む時間に参加したいのと同様に、他の同村者も好む時間に参加したい。さて、どうやって両立させようか？"},{"head":"この村がすべてという姿勢を貫こう。","log":"もし浮気がばれてしまうと、悲しいことになる。皆が傷つき、きみは信用を失う。事実がどうであれ、掛け持ちで別村にいた、他の娯楽に現を抜かしていた、などと白状しないこと。\nたとえ厳しい追及にあっても、しらを切るほうがいい。\n最初から浮気しない方法は、正直でいられる点でとても強力な防衛手段になる。"},{"head":"能力には期待がかかる。受け止めきれるかな？","log":"投票、占い、襲撃、守護、etc...。これらの能力をあてにして、皆が作戦を立てたり決断をしたりする。特に投票や占いでは、はっきりと要望されることも珍しくない。\nそれらの要求に、きみは応えきれるだろうか。また、応えきれないなら、どうしたらいいだろう。"},{"head":"役割には期待がかかる。受け止めきれるかな？","log":"まとめ役、役職CO、白黒つかない灰、etc...。こうした役割が決まってくると、どう振る舞うか期待されはじめるんだ。それを把握できているかな。\nわからないなら、どうやって知っていこう。そして、きみは期待に応えきれるだろうか。"},{"head":"楽しく参加できた？","log":"楽しく語り、聞き、素敵なひとときを過ごせたろうか。また、同様に楽しみたいと集まっている村の友人達は楽しめているだろうか。\n残念にもそうでないとしたら、どうしたら楽しくなるだろう。"},{"head":"今日も健康でいられた？","log":"健康を維持するのはとても大変なことだ。今日のきみはやり遂げただろうか。このゲームを楽しむことが引き金になって、健康を害してしまってはつまらないね。"}]}}

